  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<Hero />} />
        <Route path="/donate" element={<Information />} />
        <Route path="/request" element={<Information />} />
        <Route path="/about" element={<Information />} />
      </Routes>
      <Footer />
    </Router>
  );
};







export default Home;
